  },
  "host": "staging.uipath.com",
  "basePath": "/uipatulggiey/uipathDefault/orchestrator_/",
  "schemes": [
    "https"
  ],
  "paths": {
    "/api/Account/Authenticate": {
      "post": {
        "tags": [
          "Account"
        ],
        "summary": "Authenticates the user based on user name and password",
        "description": "Authenticates the user based on user name and password.\nDEPRECATED: \nPlease user other means to authenticate in your application. This endpoint will be removed in future releases.\nPlease refer to https://docs.uipath.com/orchestrator/reference",
        "operationId": "Account_Authenticate",
        "consumes": [
          "application/json"
        ],
        "produces": [
          "application/json"
        ],
        "parameters": [
          {
            "name": "body",
            "in": "body",
            "description": "The login parameters.",
            "schema": {
              "$ref": "#/definitions/LoginModel"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Successful authentication",
            "schema": {
              "$ref": "#/definitions/AjaxResponse"
            }
          }
        },
        "deprecated": true
      }
    },
    "/api/DirectoryService/GetDirectoryPermissions": {
      "get": {
        "tags": [
          "DirectoryService"
        ],
        "summary": "Gets directory permissions",
        "description": "OAuth required scopes: OR.Users or OR.Users.Read.\n\nRequired permissions: Users.View.",
        "operationId": "DirectoryService_GetDirectoryPermissions",
        "produces": [
          "application/json"
        ],
        "parameters": [
          {
            "type": "string",
            "name": "username",
            "in": "query"
          },
          {
            "type": "string",
            "name": "domain",
            "in": "query"
          }
        ],
        "responses": {
          "200": {
            "description": "Success",
            "schema": {
              "type": "array",
              "items": {
                "$ref": "#/definitions/DirectoryPermissionDto"
              }
            }
          }
        },
        "security": [
          {
            "OAuth2": []
          }
        ]
      }
    },
    "/api/DirectoryService/GetDomains": {
      "get": {
        "tags": [
          "DirectoryService"
        ],
        "summary": "Gets domains",
        "description": "OAuth required scopes: OR.Users or OR.Users.Read.\n\nRequired permissions: Users.View or Units.Edit or SubFolders.Edit.",
        "operationId": "DirectoryService_GetDomains",
        "produces": [
          "application/json"
        ],
        "responses": {
          "200": {
            "description": "Success",
            "schema": {
              "type": "array",
              "items": {
                "$ref": "#/definitions/DomainDto"
              }
            }
